import axios from "axios";
// require("dotenv").config(); add?

const baseURL = process.env.REACT_APP_BASE_URL = 'http://localhost:8080'; // works with link, not in env

export const fetchTrafficUpdatesData = async (latitude: number, longitude:number) => {
  try {
    const response = await axios.get(
      `${baseURL}/traffic-updates`, {
        params: {
          latitude,
          longitude,
          apiKey: process.env.REACT_APP_API_KEY, // works with link, not in env
        },
      }
    );
    return response.data;
  } catch (error) {
    console.error("Error fetching traffic data:", error);
    throw error;
  }
};
